INSERT INTO `cache_field` VALUES ('field:node:1','a:2:{s:10:\"field_body\";a:1:{s:3:\"und\";a:1:{i:0;a:3:{s:5:\"value\";s:546:\"Massachusetts’ 15 community colleges were awarded a $20 million, three-year grant from the United States Department of Labor to implement the Massachusetts Community Colleges and Workforce Development Transformation Agenda (MCCWDTA). Each community college will offer new or redesigned certificate and degree programs in one or more of the targeted industry sectors below. Each program will employ evidence-based strategies to meet the unique needs of the target population. 4,000 students will be served throughout the three-year grant period.\";s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:554:\"<p>Massachusetts’ 15 community colleges were awarded a $20 million, three-year grant from the United States Department of Labor to implement the Massachusetts Community Colleges and Workforce Development Transformation Agenda (MCCWDTA). Each community college will offer new or redesigned certificate and degree programs in one or more of the targeted industry sectors below. Each program will employ evidence-based strategies to meet the unique needs of the target population. 4,000 students will be served throughout the three-year grant period.</p>\n\";}}}s:15:\"field_image_ann\";a:0:{}}',0,1459138673,1);
